1. Terwujudnya Harmonisasi Penyelenggaraan tata kelolah pemerintahan berkualitas, bersih, transparan, mudah, cepat dan pro rakyat, dengan basis keagamaan yang kuat;
2. Terwujudnya Harmonisasi peningkatan kualitas kemakmuran ekonomi kesejahteraan sosial dan kelestarian lingkungan hidup;
3. Terwujudnya Bulukumba sebagai Pusat Layanan Jasa dan Distribusi Unggulan dan menjadi penggerak utama berkembangnya kawasan Bagian Selatan Sulawesi Selatan;
4. Meningkatnya akses dan kualitas pelayanan pendidikan, kesehatan dan infra struktur wilayah;
5. Meningkatnya daya saing daerah, sinergitas wilayah dan berkembangnya desa sejahtera dan mandiri;
6. Meningkatnya pengarusutamaan gender (PUG) dalam pengembangan perekonomian, sosial, budaya, agama dan kemasyarakatan;
7. Meningkatnya kualitas kerukunan, ketentraman dan keamanan masyarakat,
8. Meningkatkan peran Ulama, Dai, Imam-imam Desa dan Kelurahan, Imamimam Mesjid dalam melaksanakan kegiatan –kegiatan Syiar Islam;
9. Pengembangan Bulukumba sebagai Pusat Keunggulan Wisata Bahari Maritim dan Pulau;
10. Pengembangan Bulukumba sebagai sentra Keunggulan dibidang Perikanan dan Kelautan, Peternakan , Pertanian dan Hortikultura , Perkebunan;
11.Perlindungan dan Peningkatan sektor Usaha Kecil Skala Rumah Tangga dan Pedagang Pasar Tradisional sebagai pusat kegiatan ekonomi Kerakyatan yang Aman, Bersih, dan Nyaman;
12.Perlindungan dan Pelestarian kekayaan Seni Budaya Lokal, Kawasan Adat Ammatoa, dan Bahasa Lokal (Bahasa Konjo) sebagai Identitas khas Bulukumba yang berkarakter reliqius;
13. Memberdayakan Potensi Organisasi Sosial Kemasyarakatan, dan Organisasi Sosial Keagamaan, dalam menciptakan harmonisasi kerukunan kehidupan Sosial Kemasyarakatan dan Keagamaan;
14. Meningkatkan Peran serta Organisasi Kepemudaan dan Remaja Mesjid sebagai Pilar Pembinaan Generasi Muda yang Ber Ahklaq Baik, Sehat, Kuat, Kritis, Cerdas, dan Bertanggung Jawab, baik yang berbasis Kampus, Mesjid, Sekolah Menengah, Pesantren dan masyarakat umum;
15. Memberdayakan dan Memingkatkan Profesionalisme Organisasi Profesi, dan Pengusaha lokal yang bergerak dibidang jasa Pengadaan Barang dan Jasa Konstruksi, serta Perdagangan Umum lainnya, melalui Proteksi Kebijakan yang berorientasi pada Perlindungan dan Pembinaan;
16. Pembinaan Kelompok Pemuda(i) dalam Usaha Ekonomi Produktif lewat kegiatan Pelatihan dan Keterampilan;
17. Memberikan Perhatian Khusus pada Pembinaan Seni dan Olah Raga Khususnya pada Bidang Seni dan Olah Raga yang banyak digemari oleh masyarakat yang berorientasi pada Bakat dan Prestasi.

