2) MEWUJUDKAN PENYELENGGARAAN PEMERINTAHAN YANG BERSIH, EFEKTIF, EFISIEN, AKUNTABEL DAN RESPONSIVE MELALUI PERUBAHAN POLA PIKIR (MIND SET) DAN BUDAYA KERJA (CULTURE SET);
