7) MENINGKATKAN PEMBERDAYAAN PEREMPUAN DAN PENGENDALIAN PERTUMBUHAN PENDUDUK;
8) MENINGKATKAN PEMBERDAYAAN PEREMPUAN DAN PENGENDALIAN PERTUMBUHAN PENDUDUK;
