1) MENINGKATKAN KESEHATAN DAN KESEEJAHTERAAN MASYARAKAT SECARA BERKESINAMBUNGAN;
2) TERWUJUDNYA PEREKONOMIAN DAERAH YANG BERDAYA SAING GLOBAL;
3) MENINGKATKAN SUMBER DAYA MANUSIA YANG TERAMPIL, KREATIF, INOVATIF DAN BERKARAKTER;
4) TERWUJUDNYA TATA KELOLA PEMERINTAHAN YANG BAIK;
5) MENGINTEGRASIKAN NILAI-NILAI AGAMA DALAM KEHIDUPAN SOSIAL.

1) MELAYANI MASYARAKAT DAN PENGUSAHA BERDASARKAN AZAS-AZAS UMUM PEMERINTAHAN YANG BAIK;
2) MENINGKATKAN PERTUMBUHAN EKONOMI DENGAN UPAYA MENAMBAH PELUANG KERJA DAN PELUANG USAHA UNTUK MENINGKATKAN PENDAPATAN MASYARAKAT, PEMERATAAN LAYANAN KESEHATAN, PENDIDIKAN DAN MENGURANGI TINGKAT KEMISKINAN
3) MEMPERTAHANKAN KABUPATEN GRESIK SEBAGAI DAERAH TUJUAN BELAJAR ILMU AGAMA DAN INVESTASI YANG RAMAH DAN SETARA BERDASARKAN NILAI-NILAI AGAMA.

1) MEWUJUDKAN TATA KELOLA PEMERINTAHAN YANG BAIK (GOOD GOVERNANCE), YANG RESPONSIF, BERSEMANGAT DAN MEMILIKI NILAI-NILAI PENGABDIAN YANG TINGGI, ANTI KORUPSI, KOLUSI DAN NEPOTISME;
2) MENGOPTIMALKAN FUNGSI ANGGARAN UNTUK MENINGKATKAN PRODUKTIFITAS KERJA SUMBER DAYA MANUSIA MASYARAKAT KABUPATEN GROBOGAN, MELALUI PENDIDIKAN DAN KESEHATAN;
3) MENINGKATKAN KUALITAS INFRASTRUKTUR SOSIAL EKONOMI MASYARAKAT SECARA LUAS, SEPERTI JALAN DAN JEMBATAN, SEHINGGA DAPAT MENDORONG PERAN SERTA PARA PEMODAL/INVESTOR UNTUK MEMACU PENDANAAN PEMBANGUNAN DAERAH YANG BERKELANJUTAN, SERTA AGAR TERCIPTA PELUANG KERJA BAGI MASYARAKAT;
4) MENUMBUHKAN PEREKONOMIAN DAERAH UNTUK MENINGKATKAN KESEMPATAN KERJA, MELALUI PERKUATAN PEMBANGUNAN PERTANIAN DALAM ARTI LUAS, INDUSTRY, PERDAGANGAN, PEMBERDAYAAN KOPERASI USAHA KECIL DAN MENENGAH, PERTAMBANGAN DAN ENERGI;
5) MENINGKATKAN PENGELOLAAN SUMBERDAYA ALAM DENGAN MEMPERTIMBANGKAN KESERASIAN PEMANFAATAN DAN PENGENDALIAN RUANG DALAM SUATU SISTEMM PEMBANGUNAN YANG BERKELANJUTAN;
6) MENINGKATKAN PERAN SERTA DAN PEMBERDAYAAN MASYARAKAT DALAM PEMBANGUNAN, MULAI DARI PERENCANAAN, PELAKSANAAN DAN PENGAWASAN AGAR TERLAKSANA PROGRAM-PROGRAM PEMBANGUNAN DESA YANG MENYENTUH KEBUTUHAN YANG PALING DIRASAKAN OLEH MASYARAKAT DESA, SEBAGAI PUSAT-PUSAT PERTUMBUHAN PEREKONOMIAN DAN PEMBANGUNAN.

1) MENINGKATKAN KUALITAS SUMBER DAYA MANUSIA YANG BERILMU, KREATIF, INOVATIF, TERAMPIL, SEHAT JASMANI DAN ROHANI SERTA MENGUASAI ILMU PENGETAHUAN DAN TEKNOLOGI;
2) MEWUJUDKAN KESEMPURNAAN PENDIDIKAN FORMAL DAN NON FORMAL, AGAR TERBINA INSAN YANG BERAKHLAK MULIA;
3) MENINGKATKAN SISTEM IRIGASI DAN PENGELOLAAN USAHA PERTANIAN MODERN UNTUK PENGUATAN KETAHANA PANGAN;
4) MENINGKATKAN KUALITAS KEWIRAUSAHAAN DAN SELURUH KEKUATAN EKONOMI DAERAH DENGAN MENGEMBANGKAN SISTEM EKONOMI KERAKYATAN;
5) MENINGKATKAN NILAI TAMBAH INDUSTRI KECIL DAN MENENGAH YANG BERORIENTASI PASAR DAN BERDAYA SAING;
6) MENCIPTAKAN IKLIM USAHA DAN INVESTASI YANG KOMPETITIF, KONDUSIF, PROFESIONAL DAN BERKELANJUTAN;
7) MEWUJUDKAN APARATUR DAERAH YANG PROFESIONAL, BERSIH DAN BERWIBAWA GUNA MEMBERIKAN PELAYANAN PRIMA KEPADA PUBLIK;
8) MEWUJUDKAN PENGEMBANGAN NORMA RELIGIUS DALAM KEHIDUPAN SOSIAL, POLITIK DAN BUDAYA KEMASYARAKATAN.

